import React from 'react';
import Plotly from "plotly.js"
import createPlotlyComponent from 'react-plotly.js/factory';
const Plot = createPlotlyComponent(Plotly);

export  class GraphicGroup extends React.Component
{
  // console.log(this.props.name);
  render(){
    return (
    <SingleGraphic name={this.props.name} x_coordinates/>
    );
  }
}


function SingleGraphic (name, x_coordinates, y_coordinates){
  console.log(name);
  const plotlydata =[
    {
      x: x_coordinates,
      y: y_coordinates,
      type: 'bar'
    }
  ];
  return  <Plot
        data={plotlydata}
        layout={ {width: 500, height: 500, title: name} }
      />



}
